import React from 'react';

import { Button, Well } from 'react-bootstrap';

import "./css/bootstrap.min.css";
import "./css/User.css";

class User extends React.Component {

  render() {

    return (

      <div>

        <Well>

          <Button variant="primary">Primary</Button>

        </Well>

      </div>

    );
  }

}

export default User;
